import React from 'react';
import Game from '../Game/Game';
import  { } from 'semantic-ui-react';

const GamesContainer = (props) => {
    const { games } = props
    return (
        <Grid column>
            <div className='column'>
                { games.map(game => <Game game={game} />)}
            </div>
        </Grid>

    )
}



export default GamesContainer;
